import "./App.css";

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { Navbar } from "./components/navbar";
 import { Shop } from "./pages/shop/shop";
 import AboutUs from "./pages/AboutUs";
import HomePage from "./pages/HomePage";
import Billing from "./pages/Billing";
import PaymentOptions from './PaymentOptions';
import VisaPayment from './VisaPayment';
import MastercardPayment from './MastercardPayment';
import PaypalPayment from './PaypalPayment';
import { Cart } from "./pages/cart/cart";


import { ShopContextProvider } from "./context/shop-context";

function App() {
  return (
    <div className="App">
      <ShopContextProvider>
        <Router>
          <Navbar />
          <Routes>
            <Route path="/" element={<HomePage />} />

            {<Route path="/AboutUs" element={<AboutUs />} /> }
            <Route path="/shop" element={<Shop />} />
            <Route path="/cart" element={<Cart />} />
            <Route path="/Billing"element={<Billing/>} />
            <Route path="/Payment"element={<Payment/>} />
            <Route exact path="/payment" component={PaymentOptions} />
        <Route exact path="/payment/visa" component={VisaPayment} />
        <Route exact path="/payment/mastercard" component={MastercardPayment} />
        <Route exact path="/payment/paypal" component={PaypalPayment} />
          </Routes>
        </Router>
      </ShopContextProvider>
    </div>
  );
}
export default App;
